//     <div>News</div>
//   )
// }

// News.propTypes = {}

// export default News


const MyNews = ({users}) => {



    return (
        <div className="container">
        <h2>Latest News API</h2>



        <div className="row">

        {
                users.map((curElem) => {
                 const { date, title, url, image, desc, author, id, name, cont  } = curElem;

            return (

                    <div className='col-12 col-md-4 col-lg-3 mb-4' key={id}>  
                    <div className="card-group">
                      <div className="card" >
                        <img className='img-fluid' src={image} alt='Image' />
                        <div className="card-body">
                          <h4 className="card-title">{title}</h4>   
                          <small>{date}</small> 
                          <small>{name}</small> 
                          <p className="card-text">{desc}</p>
                          <p className="card-text">{cont}</p> 
                           <a className="btn btn-secondary btn-sm" target="_blank" href={url}>Read More </a>
                        </div>
                      <div className="card-footer">
                        <small className="text-muted"><strong>Author</strong>{author}</small>
                      </div>
                    </div>  
                    </div>
                    </div>


            )
            })        

            } 
           </div>
       </div>
    )
}

export default MyNews;
